import './App.css';
import { BrowserRouter } from 'react-router-dom';
import Footer from './components/Footer';
import Header from './components/Header';
import AllRoutes from './AllRoutes';

function App() {
  return (
    <div className='App'>

        <Header />
        <Hero />
        <AboutMe />
        <Portfolio />
        <Skills />
        <Contact /> 
        <Footer />  
    </div>
  );
}

export default App;
